import { createStore } from 'vuex';
import router from '@/router';

const state = {};
const getters = {};
const mutations = {
  redirectTo(state, payload){
    this.$router.push({ name: "Home" });
  }
};
const actions = {
  redirectTo({commit}){
    commit("redirectTo");
  }
};

export default createStore({
  state,
  getters,
  mutations,
  actions,
  modules: {
  }
})
